template.declaration:
int i=0;

void saveValves(valve_conf_t v_conf) {
   for (i:con_valve_t)    {
      control_valve[i] = ((v_conf & (1<<(i-1)))==(1<<(i-1)));
   }
   for (i:con_valve_t) {
    valve[i] = control_valve[i];
   } 
}

void greedyController()   {
    int capUsed = 0;
    for (i:uncon_valve_t) {
        if ((T[i] < Tg[i]) && ((capUsed + capacity[i]) <= maxCapRight) )   {
            capUsed = capUsed + capacity[i]; 
            valve[i] = 1;
        }    
        else
            valve[i] = 0;
    }
    //maxCapLeft = maxCapacity - capUsed;
}



zonotope_t getZonotope() {
    zonotope_t zt = 0;
    for (i:con_valve_t)    {
      if (T[i] > 20)
          zt = zt + (1<<(i-1))  ;
    }
    return zt;
}

bool validPatternId(pat_t p, zonotope_t ztid) {
    if (allPatterns[ztid][p][1] == -2) 
        return false;
    else   
        return true;
}


int getAvailable(zonotope_t curr_zt,pat_t p_id) {
    int av=0;
    for (i:pat_len_t) {
        if (allPatterns[curr_zt][p_id][i] >= 0)
            av = av + 1;
    }
    return av;
}


void applyPattern(zonotope_t curr_zt, pat_t p_id, pat_len_t ppos) {
    pat_elem_t pat_elem = allPatterns[curr_zt][p_id][ppos];
    for (i:con_valve_t)    {
      valve[i] = patternMap[i][pat_elem];
   }    

}






