void resetDoorsValves() {
  int j = 0;
  for (j:door_t)    {
      door[j] = 0;
  }
  for (j:valve_t)    {
      valve[j] = 0;
  } 
  for (j:con_valve_t)    {
      control_valve[j] = 0;
  } 
}
